import styled from 'styled-components'

const Wrapper = styled.div`
  clear: both;
  position: absolute;
  bottom: 0;
  height: 52px;
  width: 100vw;
  background: ${props => props.theme.color};
  color: ${props => props.theme.bgColor};
  margin-top: -52px;
`

export default () => (
  <Wrapper>
    <div>
      <h1>Buy Me A Coffee :-)</h1>
    </div>
  </Wrapper>
)
